import './App.css';
import MyField from './components/myField';

function App() {
  return (
    <div className="App">
      <h1 className="aviaSales">авиасэйлс</h1>
      <a className="registracion "> Зарегистрироваться</a>
      <a className="entrance"> Войти</a>
      <Link to='/posts/'>className="title">Поиск дешёвых авиабилетов</Link>

      <div className="box">

        <MyField />
      </div>
    </div>
  );
}

export default App;
